const getDog = async (breedId) => {

    

    const url = "http://localhost:8000/showAPI";
    const res = await fetch(url);
    const data = await res.json();
    
    console.log(data[5]);

    const dog = {
			image: data.image_url,
			breed: {
				id: data.id,
				name: data.name,
			},
		};
    return dog
}

export default getDog;
